USE master;

CREATE DATABASE BC_Students;

USE BC_Students;
GO

CREATE TABLE Student
(
	StudentID VARCHAR(6) PRIMARY KEY,
	Name VARCHAR(20) NOT NULL,
	Surname VARCHAR(20) NOT NULL,
	Image VARBINARY(MAX) NOT NULL,
	DOB DATE NOT NULL,
	Gender VARCHAR(6) NOT NULL,
	Phone VARCHAR(10) NOT NULL UNIQUE,
	Address VARCHAR(70) NOT NULL
);

CREATE TABLE Module
(
	ModuleCode VARCHAR(6) PRIMARY KEY,
	ModuleName VARCHAR(50) NOT NULL,
	Description VARCHAR(MAX) NOT NULL,
	Links VARCHAR(MAX) NOT NULL
);

CREATE TABLE StudentModule
(
	StudentID VARCHAR(6),
	ModuleCode VARCHAR(6),
	CONSTRAINT FK_StudentModule_Student FOREIGN KEY (StudentID) REFERENCES Student(StudentID),
    CONSTRAINT FK_StudentModule_Module FOREIGN KEY (ModuleCode) REFERENCES Module(ModuleCode),
    PRIMARY KEY (StudentID, ModuleCode)
);
GO

